(anglican.infcomp.core/reset-infcomp-addressing-scheme!)

(defn poly [w x]
  (reduce #(-> %1 (* x) (+ %2)) (reverse w)))

(with-primitive-procedures [poly pow]
  (defquery polynomial-regression [y x on]
    (let [;randomise on and x for compilation
          on (map #(observe (flip 0.7) %1) on)					
          x (map #(observe (uniform-continuous -10 10) %1) x)
          
          x (map #(if %1 %2 0) on x)
          
          order (sample (discrete [0.25 0.3 0.3 0.15]))
          w0 (sample (laplace 0 10))
          w1 (sample (laplace 0 1))
          w2 (sample (laplace 0 0.1))
          w3 (sample (laplace 0 0.01))
          W (take (inc order) [w0 w1 w2 w3])]
      (map #(observe (student-t-loc-scale 4 (poly W %1) 1) %2) x y)
    W)))
