(defn combine-observes-fn [observes]
  (let [on (map :value (take 15 observes))
        x (map :value (take 15 (drop 15 observes)))
        y (map :value (take 15 (drop 15 (drop 15 observes))))]
    (concat on x y))
  )

(combine-observes-fn (prior/sample-observes-from-prior polynomial-regression [(linspace -1 1 15) (linspace -1 1 15) (repeat 15 true)] ))
